import styled from "styled-components";


export const Content = styled.div`
.listItem{
    min-width: 10rem;
    max-width: 10rem;
    min-height: 10rem;
    max-height: 10rem;
    display: inline-block;
    margin:1.2rem;
    img{
        max-width: 100%;
        object-fit: cover;
    }
}
`
